import React, { Component } from 'react';
import moment from 'moment'

class Metrics extends Component {
    state = { 
        currentUser: this.props.currentUser,
        currentDate: moment() 
    }

    componentDidMount() {
        this.props.currentUser.appointments.map(appointments => this.setState(
            {
                dates : [...this.state.dates, appointments.date]
            }))
    }


    render() {
        console.log(this.state)
        console.log(this.state.currentDate.toDate())
        console.log(moment("2019-12-22").isSame(this.state.currentDate, 'week'))
        return ( 
            <div className="metrics-page">
                <h1>Metrics</h1>
            </div>
        );
    }
}

export default Metrics;
